import './App.css';
import './bounce.css';
import React from 'react';


function App() {
  return (
  <>
      {/* <div id="App" className="sticky"  ></div>

      <div id ="picture" className="sticky"><img id ='picture1' src={pic1} alt="picture1" /></div>

      <div id="aboutMe" className="sticky">
        
      </div> */}

 
  <div class="bouncing-text">
    <div class="b">B</div>
    <div class="o">O</div>
    <div class="u">U</div>
    <div class="n">N</div>
    <div class="c">C</div>
    <div class="e">E</div>
    <div class="shadow"></div>
    <div class="shadow-two"></div>
  </div>
  </>
  );
}



export default App;
